import { TradeAction, TRADE } from "./types";

export function trade(
  entityId: string,
  givenResources: string,
  getResources: string,
  playerName: string
): TradeAction {
  return {
    type: TRADE,
    entityId,
    givenResources,
    getResources,
    playerName,
  };
}
